import React from 'react';
import Card from '../UI/Card';
import classes from './ListAccounts.module.css';
import AccountStatement from './AccountStatement';
import {
  BrowserRouter as Router,
  Routes,
  Route,
  Link,
  Redirect
} from "react-router-dom";

const DummyAccounts = [
	{id: "1", name:"Salman"},
	{id: "2", name:"Ali"},
	{id: "3", name:"Nobahar"}
];


function ListAccounts(props)	{

	return (
		<Card>
			<button onClick={props.logout}>Logout</button>
			<Router>
				<ul classes={classes.account}>
				{
					DummyAccounts.map(account => (
						<li key={account.id}  >

							<Link to="/AccountStatement">{account.name}</Link>

						</li>
					))
				}

	            </ul>
				<Routes>
					{
						DummyAccounts.map(account => (
							<Route exact path="/AccountStatement" element={<AccountStatement name={account.name} />} key={account.id} />
						))
					}
				</Routes>
			</Router>
		</Card>
	)
}

export default ListAccounts;
